import React from 'react';
import Data from './ListData.json';

function SearchBar() {

return (
    <div>
        <div>
      <input placeholder="Search Collections"/>
    </div>
        {
        Data.map((post) => (
          <div key={post.id}>
            <p>{post.text}</p>
          </div>
        ))
        }
    </div>
)


};

export default SearchBar;
